import React from "react";
import "./Cong_nghe.css";

function Cong_nghe() {
  return (
    <div className="Cong_nghe">
      <img
        src="https://www.suzuki.com.vn/_next/image?url=https%3A%2F%2Fdoftr40680fkg.cloudfront.net%2Fall-page%2Ffeature-images%2Fdesk-banner%2FPC_1695897072386.png&w=2048&q=75"
        alt="hình banner"
      />

      <div className="row">
        <div className="col-md-6">
          <img
            src="https://www.suzuki.com.vn/_next/image?url=https%3A%2F%2Fdoftr40680fkg.cloudfront.net%2Fall-page%2Foneslide%2Fdesktop%2F1_1695897198275.png&w=1080&q=75"
            alt="hình banner"
          />
        </div>
      </div>
    </div>
  );
}

export default Cong_nghe;
